from typing import List, Dict, Tuple
from collections import deque

class Solution:
    def validWaterGrids(self, i, j, grid) -> List[Tuple[int, int]]:
        ans = []
        for dr, dc in [(1,0), (-1,0), (0,1), (0,-1)]:
            new_r, new_c = i + dr, j + dc
            if 0 <= new_r < self.R and 0 <= new_c < self.C and (grid[new_r][new_c] == 0):
                ans.append((new_r, new_c))
        return ans

    def BFS(self, grid: List[List[int]], dist_map:Dict[Tuple[int, int], int], roots: List[Tuple[int, int]]) -> Dict[Tuple[int, int], int]:
        #visited: Dict[Tuple[int, int], int] = {} # (row, col) -> depth
        queue = deque(roots)
        max_dist = self.R*2 + self.C*2 

        ans_max = -1

        while queue:
            r, c = queue.popleft()
            depth = dist_map[(r, c)]
            ans_max = max(ans_max, depth)

            # visit its neighbors
            water_grids = self.validWaterGrids(r, c, grid)
            for new_pos in water_grids:
                # Skip visited node
                if dist_map[new_pos] != max_dist:
                    continue

                # Update distance map to mark as visited
                dist_map[new_pos] = min(dist_map[new_pos], depth + 1)
                # push to queue
                queue.append(new_pos)

        return dist_map, ans_max

    def maxDistance(self, grid: List[List[int]]) -> int:
        self.R, self.C = len(grid), len(grid[0])
        max_dist = self.R*2 + self.C*2 
        # dist_map[r, c] = the distance of the water cell (r, c) to the nearest land
        dist_map = {(i, j):0 if grid[i][j] == 1 else max_dist for i in range(self.R) for j in range(self.C)}

        # Find the initial BFS positions: land grids with at least one water grid nearby
        bfs_roots = [(r, c) for r, c in dist_map.keys() if (len(self.validWaterGrids(r, c, grid)) > 0) and grid[r][c] == 1]

        # Start BFS on each root
        dist_map, ret_max = self.BFS(grid, dist_map, bfs_roots)

        return ret_max if ret_max != max_dist and ret_max != 0 else -1
        


